import React from "react";

const AddContact = ({ handelChange, add }) => {
  return (
    <div className="add-card">
      <p className="card-title-add">New Contact</p>

      <input
        name="name"
        type="text"
        placeholder="Name..."
        onChange={handelChange}
      />

      <input
        name="phone"
        type="text"
        placeholder="Phone..."
        onChange={handelChange}
      />

      <input
        name="email"
        type="text"
        placeholder="Email..."
        onChange={handelChange}
      />

      <input
        type="button"
        value="Add Contact"
        className="add-button"
        onClick={add}
      />
    </div>
  );
};

export default AddContact;
